    "Crosby Wetland Management District annual narrative report: Calendar year 1991",nt"tracking_summary":
    {ntt"total": 1,ntt"recent": 1nt},nt"groups": [],nt"relationships_as_subject":
    [],nt"revision_timestamp": "2016-07-27T22:56:04.256596",nt"name": "crosby-wetland-management-district-annual-narrative-report-calendar-year-1991",nt"isopen":
    false,nt"url": null,nt"notes": "This annual narrative report for Crosby
    National Wildlife Refuge outlines Refuge accomplishments during the 1991 calendar
    year. The report begins with a summary of the year's highlights and weather conditions.
    Land acquisition is covered. The planning section discusses the management plan.
    Refuge administration is outlined; information about personnel, volunteer programs,
    safety, and technical assistance is given. Habitat management is also covered; subjects
    include wetlands, croplands, grasslands, other habitat, grazing, haying, fire management,
    pest control, and WPA easement monitoring, and private lands enhancement. The wildlife
    section of the report discusses endangered and threatened species, waterfowl, other
    migratory birds, game mammals, other resident wildlife, animal control, and disease
    prevention and control. The public uses of the Refuge described in this report include
    interpretive programs, hunting, and law enforcement. The equipment and facilities
    section of the report provides information about equipment utilization and replacement.
    Cooperative programs and items of interest are provided at the end. Photographs
    and refuge brochures are attached. A narrative report for Lake Zahl National Wildlife
    Refuge is included.",nt"license_title": "License Not Specified",nt"extras":
